### 题解

#### 1.暴力解法

使用两层循环，第一层循环遍历数组，第二层循环遍历第一层循环之后的数组，判断两个数之和是否等于目标值，如果等于目标值，则返回两个数的下标。
class Solution {
    public int[] twoSum(int[] nums, int target) {
        int[] result = new int[2];
        for(int i = 0; i < nums.length; i++){
            for(int j = i+1; j < nums.length; j++){
                if(nums[i] + nums[j] == target){
                    result[0] = i;
                    result[1] = j;
                    return result;
                }
            }
        }
        return result;
    }
}

#### 2.哈希表

使用哈希表存储数组的值和下标，遍历数组，判断目标值减去当前值是否在哈希表中，如果在，则返回当前值的下标和目标值减去当前值的下标。
class Solution {
    public int[] twoSum(int[] nums, int target) {
        Map<Integer, Integer> map = new HashMap<>();
        for(int i = 0; i < nums.length; i++){
            if(map.containsKey(target - nums[i])){
                return new int[]{map.get(target - nums[i]), i};
            }
            map.put(nums[i], i);
        }
        return new int[0];
    }
}

