    // 1. 题目要求：给定一个整数数组 nums 和一个整数 k，返回该数组所有大小为 k 的子数组中的最大值。
    // 2. 思路：使用双端队列（deque）来维护一个单调递减的队列，队首元素即为当前窗口的最大值。
    // 3. 算法步骤：
    //    a. 初始化一个空的双端队列 deque 和结果数组 res。
    //    b. 遍历数组 nums：
    //        i. 当队列非空且队尾元素小于当前元素时，弹出队尾元素（保持队列单调递减）。
    //        ii. 将当前元素的下标加入队尾。
    //        iii. 检查队首元素是否在窗口内（即下标是否大于等于当前窗口的左边界 i-k+1），如果不在则弹出队首。
    //        iv. 当窗口形成（即 i>=k-1）时，将队首元素（即当前窗口最大值）加入结果数组。
    // 4. 注意：队列中存储的是下标，方便判断队首元素是否在窗口内。
    public int[] maxSlidingWindow(int[] nums, int k) {
        if (nums == null || nums.length == 0 || k <= 0) {
            return new int[0];
        }
        int n = nums.length;
        int[] res = new int[n - k + 1]; // 结果数组大小为 n-k+1
        Deque<Integer> deque = new ArrayDeque<>(); // 双端队列存储下标

        for (int i = 0; i < n; i++) {
            // 移除所有小于当前元素的队尾元素，以保持队列单调递减
            while (!deque.isEmpty() && nums[deque.peekLast()] < nums[i]) {
                deque.pollLast();
            }
            deque.offerLast(i); // 将当前下标加入队尾

            // 检查队首元素是否在窗口内，如果不在则弹出
            if (deque.peekFirst() < i - k + 1) {
                deque.pollFirst();
            }

            // 当 i >= k-1 时，窗口形成，记录结果
            if (i >= k - 1) {
                res[i - k + 1] = nums[deque.peekFirst()];
            }
        }
        return res;
    }
}
